FE4CC011EA8F18D8CD39EB961B\" xmpMM:InstanceID=\"xmp.iid:676007FD4CC011EA8F18D8CD39EB961B\" xmp:CreatorTool=\"Adobe Photoshop CC 2015 (Macintosh)\"> <xmpMM:DerivedFrom stRef:instanceID=\"xmp.iid:0350cc0e-cf0c-4774-bd2a-64abf16a4561\" stRef:documentID=\"xmp.did:9EC990C00920681197ABBA11E79F9BBD\"/> <dc:creator> <rdf:Seq> <rdf:li>Maja Smend</rdf:li> </rdf:Seq> </dc:creator> </rdf:Description> </rdf:RDF> </x:xmpmeta> <?xpacket end=\"r\"?>'),(8,'Probably the most widely-used oil in cooking, olive oil is pressed from fresh olives. It\'s mainly made in theMediterranean, primarily in Italy, Spain and Greece (though countries such as America and Australia also produce it). Much like wine-making, climate, soil and the way the olives are harvested and pressed all have an impact on an oil\'s character. Olive oil is assessed on three criteria – fruitiness, bitterness and pepperiness. The flavour, smell and colour can vary radically, both according to its origin, as well as whether it\'s extra virgin (the finest grade) or not. Generally speaking, the hotter the country, the more robust the flavour of the oil. It is also possible to flavour olive oil with herbs and spices by steeping them in the oil for ten days or so (though chilli needs far less time).','Olive Oil',_binary 'RIFFl\0\0WEBPVP8X\n\0\0\0\0\0\0v\0T\0VP8 Zh\0\0\w*wU>1C!{\\ dW\0l\c(1j\\C\3\\\[Wï9\_\/?\\G?_?\\>\3i\\\w?\\\s\/\\/=ҿ\k+\\?\\߶_\?tf1_Cw\K\\'/R?i\\\\\t!~\s\=\v7\`x\\\o}C\/\\U\o\O\߶\0\\\1{?߼~\\ȗO\\\v\\\;79m\&\g;<\\\r3hHg\uu(xn\ZroX|{\\AU\\М6\\\y%\\rPsS\B\z\M/0|ڷZAy5ܻ1hr`\\LUCD\SPu#zF`QO\X \l@\	\]b_~\R?w8	\F0I;\H_\2E34\N`R/6]fp\EUĐj k\h&3VMJ.	d\\r\Zs4OfI\\\d|jv\鿁\\<b++a!\ZMI9+x\1;\ns\nnZ\ύݫ:\0\ƽȤ@h\\ 1\b\6-\̲\I\\n.\\\­\'x($b`\\1\'6G\nXDʱ~\*\yE͏\ӵ\48\ڢͼ\\>p9ƺo\\MI`SJ\Tޤ\>B+{م5^,y-\DwW\'~+Q\G!f\7\Ji1\j]\Z\j^?$눰\\T0\\RD\mRYHdL+𷾡\/\\|\\\o\\h\\;\'A|\\҈8˒\Q{M9\\0;\nK\\\7h\}8K\ [%W*t C\5>9\\0V\'\FA\k\\nNbLSG@\0\+