om separating whole milk or cream into fat and buttermilk. The fat is compressed and chilled into blocks of butter. It can be used directly as a condiment or melted for frying or coating. Butter is also used in baking, such as in classic sponges and pastries, or for enriching sauces. Butter can be bought salted or unsalted. Salt is used for preservation and flavour, but varies according to the breed of cow and its feed. Butter is around 80 per cent fat and for this reason, many people prefer to use alternatives. Low-fat spreads are generally not suitable for baking so read packaging carefully.','Butter',_binary 'RIFFz\'\0\0WEBPVP8X\n\0\0\0\0\0\0v\0T\0VP8 T#\0\0p\0*wU>1C!!$`@	enP\m\c_\\Bq\~T~U|\򿑿TO\\]?\~\\Ys\W\\\'?\}UKk7\-\oG.E\.\ω/\=4p{\0227nd\Ν8h\\':\Z-`#uHM\.̻ՖW\hL\\\b\\Ӣ\\{\gؼ&wЛ\@p7wqJQ\0^*vӽ\2>\V3ҕ\NPTR0\r\0\M\e%\omlVo\' \t\C\)\6c\Xσ\v\\қ\mϬ\\8\E+\>rR4\P9\rc\&PӸgo8r~\v\4$&\@?τ[\.s\"\6>\'n4\D8\\珰%o\\c\^D\\ˎ>5\:fy##\7\\.\\&\'\;##\\G\TZb\x\Ֆ\)\':%X\\{\\\<.g7q%wir,3\Ա\\'m\@k5X,_3\\$De\e\KcFz:OM	?\((H\{>V`p\+\\0rYA5\\\bb/IS#\W3\{둂Eg\Z@=A#U\R0*;:B\;)\\d\O\v\\\w[\r#/adI!\CQS[sDV\Օ\q\~.,\+Ef\\'\:<^G/(A;\\'\rftx\fls\s{6B`L\R\6\%Sٰ^\n\\n}\\'fs\{m\'VE,4|iҋ۱\\ry;\\D-\b\?moN6U\\>V$L\):\`\T\M&]`ꎊP\\+N\-h\]\.\n/j^\1cU\0\Kq;\\m\\\b\R\D\w\k\A\*}\*пfx|\.\r\T>\Z\`\H\\ɽOA0xcsߦ\?m\^h1M;p<\\\jӵlXG{[u\*\N+?`+m\\\/ܪ\:Ø\)U\\7\C\"_\d\rѡnM^\\ \hZ\R+-\M,:׹8h!<\[ \D	{\|\Q\e\\/\Zv\mkQ\T\E&@RF5 .\03\\3\9\?ڏ\;V\a\"\rj*\A\n&E\\n\\wCeO\\\\\\=~Ys\8S$/?\iLnǂLGڠlx\mZ)(\"J\\\Zw{v\;\z\KUW\)ih&\+eK\\nR\͓`@&AG$gF*F\\EHT|.	~\\\j@wD>w\?[\-A܊V&\\"\\\\"\z^\#	\\\BW*\\\Z\\Se|\\0=/SnQb\.\u\w\9j]\/#\&Fm\'=gĔZy>K?/\Ё9g\\qn\oz7q&\^Q\z\x\\h\0ޡ\wR\1\\컻{M|\\HSQHp?\N\&\r$Z\'f}T<\Z\\\!\\\]u+rϮ\=0;(\J\\Z\\p\<c\\k\KX\0\X\K\㍨Z\6#`fSt4\"]g(\\͈\a7N\'/9D 1^?남\ONYfJJ\0\.\b\ZKܘ#\\תl:la\5EN񻑩zX\oY>xvaTCC\\s^oʨZs,\j	\KdУaԮ`&|8\\P\B